function setStatus(msg) {
  els.status.textContent = msg || "";
}

function clamp(n, min, max) {
  return Math.max(min, Math.min(max, n));
}

function shiftBox(b, dx = 0, dy = 0) {
  return { x: b.x + dx, y: b.y + dy, w: b.w, h: b.h, radius: b.radius ?? 0 };
}

function normalizeNewlines(s) {
  return (s || "").replace(/\r\n/g, "\n").replace(/\r/g, "\n");
}

function splitLines(text) {
  return normalizeNewlines(text).split("\n");
}

function measureWrappedLines(ctx, text, maxWidth) {
  const words = text.split(/(\s+)/); // keep spaces
  let lines = [];
  let line = "";
  for (const w of words) {
    const test = line + w;
    if (ctx.measureText(test).width <= maxWidth || line === "") {
      line = test;
    } else {
      lines.push(line.trimEnd());
      line = w.trimStart();
    }
  }
  if (line.trim().length) lines.push(line.trimEnd());
  return lines;
}

function wrapText(ctx, text, maxWidth) {
  // Wrap each explicit newline separately
  const blocks = splitLines(text);
  let out = [];
  for (const b of blocks) {
    if (!b.trim()) {
      out.push("");
      continue;
    }
    out.push(...measureWrappedLines(ctx, b, maxWidth));
  }
  return out;
}

function drawTextInBox(options) {
  const {
    text,
    box,
    color = "#d10000",
    align = "left",
    valign = "top",
    fontFamily = '"Yu Gothic","Meiryo","Hiragino Kaku Gothic ProN","Noto Sans JP",sans-serif',
    fontWeight = "800",
    maxFont = 64,        // used as target size (and as max when autoFit)
    minFont = 10,
    lineGap = 1.15,
    maxLines = 0,        // 0 = unlimited
    autoFit = true,      // shrink until it fits
  } = options;

  const t = (text ?? "").toString();
  if (!t.trim()) return;

  // Helper: wrap with a given size
  const wrapAt = (sizePx) => {
    ctx.font = `${fontWeight} ${sizePx}px ${fontFamily}`;
    const lines = wrapText(ctx, t, box.w);
    return (maxLines > 0) ? lines.slice(0, maxLines) : lines;
  };

  let size = Math.max(minFont, Number(maxFont) || 0);
  let finalLines = [];

  if (autoFit) {
    // Fit font size by shrinking until it fits height
    size = Math.max(minFont, Number(maxFont) || 0);
    while (size >= minFont) {
      const lines = wrapAt(size);
      const lineHeight = Math.ceil(size * lineGap);
      const totalH = lines.length * lineHeight;
      if (totalH <= box.h + 0.5) {
        finalLines = lines;
        break;
      }
      size -= 1;
    }

    if (!finalLines.length) {
      size = minFont;
      finalLines = wrapAt(size);
    }
  } else {
    // Fixed size: clip to box (so slider always "works")
    const lines = wrapAt(size);
    const lineHeight = Math.ceil(size * lineGap);
    const maxFit = Math.max(1, Math.floor((box.h + 0.5) / lineHeight));
    finalLines = lines.slice(0, maxFit);

    // If clipped, add ellipsis to the last line
    if (lines.length > maxFit && finalLines.length) {
      const last = finalLines[finalLines.length - 1];
      ctx.font = `${fontWeight} ${size}px ${fontFamily}`;
      const ell = '…';
      let trimmed = last;
      while (trimmed.length > 0 && ctx.measureText(trimmed + ell).width > box.w) {
        trimmed = trimmed.slice(0, -1);
      }
      finalLines[finalLines.length - 1] = trimmed + ell;
    }
  }

  const lineHeight = Math.ceil(size * lineGap);
  let y = box.y;
  const totalH = finalLines.length * lineHeight;

  if (valign === "middle") y = box.y + (box.h - totalH) / 2;
  if (valign === "bottom") y = box.y + (box.h - totalH);

  ctx.fillStyle = color;
  ctx.textBaseline = "top";

  // Clip to the box so fixed mode can't spill outside
  ctx.save();
  ctx.beginPath();
  ctx.rect(box.x, box.y, box.w, box.h);
  ctx.clip();

  for (let i = 0; i < finalLines.length; i++) {
    const line = finalLines[i];
    let x = box.x;
    const w = ctx.measureText(line).width;

    if (align === "center") x = box.x + (box.w - w) / 2;
    if (align === "right") x = box.x + (box.w - w);

    ctx.fillText(line, x, y + i * lineHeight);
  }

  ctx.restore();
}

function drawRoundedClip(ctx, x, y, w, h, r) {
  const rr = Math.min(r, w/2, h/2);
  ctx.beginPath();
  ctx.moveTo(x + rr, y);
  ctx.arcTo(x + w, y, x + w, y + h, rr);
  ctx.arcTo(x + w, y + h, x, y + h, rr);
  ctx.arcTo(x, y + h, x, y, rr);
  ctx.arcTo(x, y, x + w, y, rr);
  ctx.closePath();
  ctx.clip();
}

function drawArt() {
  if (!artImg) return;
  const {x,y,w,h,radius} = LAYOUT.art;

  ctx.save();
  drawRoundedClip(ctx, x, y, w, h, radius);

  const fit = els.artFit.value;
  const zoom = Number(els.artZoom?.value || 1) || 1;
  const panX = Number(els.artPanX?.value || 0) || 0;
  const panY = Number(els.artPanY?.value || 0) || 0;
  const iw = artImg.naturalWidth || artImg.width;
  const ih = artImg.naturalHeight || artImg.height;

  const baseScale = (fit === "contain") ? Math.min(w/iw, h/ih) : Math.max(w/iw, h/ih);
  const scale = baseScale * zoom;
  const dw = iw * scale;
  const dh = ih * scale;
  const dx = x + (w - dw) / 2 + panX;
  const dy = y + (h - dh) / 2 + panY;
  ctx.drawImage(artImg, dx, dy, dw, dh);

  ctx.restore();
}

function drawGuides() {
  if (!els.showGuides.checked) return;
  ctx.save();
  ctx.strokeStyle = "rgba(47,125,255,.8)";
  ctx.lineWidth = 2;

  const drawRect = (b) => ctx.strokeRect(b.x, b.y, b.w, b.h);
  for (const k of Object.keys(LAYOUT.guides)) drawRect(LAYOUT.guides[k]);

  ctx.strokeStyle = "rgba(255,255,255,.35)";
  ctx.setLineDash([6,6]);
  drawRect(LAYOUT.art);

  ctx.restore();
}

