function applyState(st) {
  els.mode.value = st.mode ?? "player";
  els.textColor.value = st.textColor ?? "#d10000";
  els.name.value = st.name ?? "";
  els.subtitle.value = st.subtitle ?? "";
  els.rarity.value = st.rarity ?? "ダイナミックレア";
  els.fugu.value = (st.fugu ?? "") !== "" ? String(st.fugu) : "";
  els.org.value = st.org ?? "";
  els.role.value = st.role ?? "";
  els.ability.value = st.ability ?? "";
  els.debuff.value = st.debuff ?? "";
  els.tips.value = st.tips ?? "";
  els.itemTips.value = st.itemTips ?? "";
  els.artFit.value = st.artFit ?? "cover";
  els.artZoom.value = String(st.artZoom ?? 1);
  els.artZoomNum.value = String(st.artZoom ?? 1);
  els.artPanX.value = String(st.artPanX ?? 0);
  els.artPanXNum.value = String(st.artPanX ?? 0);
  els.artPanY.value = String(st.artPanY ?? 0);
  els.artPanYNum.value = String(st.artPanY ?? 0);

  // position offsets
  // position (group + per-field)
  const meta = st.metaOffset || { x: 0, y: (st.metaYOffset ?? -64) }; // metaYOffset is legacy
  if (els.metaX && els.metaXNum) {
    const v = String(meta.x ?? 0);
    els.metaX.value = v;
    els.metaXNum.value = v;
  }
  if (els.metaY && els.metaYNum) {
    const v = String(meta.y ?? -64);
    els.metaY.value = v;
    els.metaYNum.value = v;
  }

  // role icon size
  if (els.roleIconSize && els.roleIconSizeNum) {
    const v = String(st.roleIconSize ?? 64);
    els.roleIconSize.value = v;
    els.roleIconSizeNum.value = v;
  }

  const off = st.offsets || {};
  const setPair = (r, n, v) => {
    const val = String(v ?? 0);
    if (r) r.value = val;
    if (n) n.value = val;
  };

  setPair(els.posRoleIconX, els.posRoleIconXNum, off.roleIcon?.x ?? 0);
  setPair(els.posRoleIconY, els.posRoleIconYNum, off.roleIcon?.y ?? 0);

  setPair(els.posNameX, els.posNameXNum, off.name?.x ?? 0);
  setPair(els.posNameY, els.posNameYNum, off.name?.y ?? 0);
  setPair(els.posSubtitleX, els.posSubtitleXNum, off.subtitle?.x ?? 0);
  setPair(els.posSubtitleY, els.posSubtitleYNum, off.subtitle?.y ?? 0);

  setPair(els.posRarityX, els.posRarityXNum, off.rarity?.x ?? 0);
  setPair(els.posRarityY, els.posRarityYNum, off.rarity?.y ?? 0);
  setPair(els.posFuguX, els.posFuguXNum, off.fugu?.x ?? 0);
  setPair(els.posFuguY, els.posFuguYNum, off.fugu?.y ?? 0);
  setPair(els.posOrgRoleX, els.posOrgRoleXNum, off.orgrole?.x ?? 0);
  setPair(els.posOrgRoleY, els.posOrgRoleYNum, off.orgrole?.y ?? 0);

  setPair(els.posAbilityX, els.posAbilityXNum, off.ability?.x ?? 0);
  setPair(els.posAbilityY, els.posAbilityYNum, off.ability?.y ?? 0);
  setPair(els.posDebuffX, els.posDebuffXNum, off.debuff?.x ?? 0);
  setPair(els.posDebuffY, els.posDebuffYNum, off.debuff?.y ?? 0);

  setPair(els.posTipsX, els.posTipsXNum, off.tips?.x ?? 0);
  setPair(els.posTipsY, els.posTipsYNum, off.tips?.y ?? 0);
  setPair(els.posItemTipsX, els.posItemTipsXNum, off.itemTips?.x ?? 0);
  setPair(els.posItemTipsY, els.posItemTipsYNum, off.itemTips?.y ?? 0);

  const fs = st.fontSizes || {};
  const setFS = (r, n, v) => {
    const val = String(v);
    r.value = val;
    n.value = val;
  };
  setFS(els.fsName, els.fsNameNum, fs.name ?? 52);
  setFS(els.fsSubtitle, els.fsSubtitleNum, fs.subtitle ?? 34);
  setFS(els.fsRarity, els.fsRarityNum, fs.rarity ?? 22);
  setFS(els.fsFugu, els.fsFuguNum, fs.fugu ?? 30);
  setFS(els.fsOrgRole, els.fsOrgRoleNum, fs.orgRole ?? 16);
  setFS(els.fsAbility, els.fsAbilityNum, fs.ability ?? 64);
  setFS(els.fsDebuff, els.fsDebuffNum, fs.debuff ?? 42);
  setFS(els.fsTips, els.fsTipsNum, fs.tips ?? 40);
  setFS(els.fsItemTips, els.fsItemTipsNum, fs.itemTips ?? 36);
  els.showGuides.checked = !!st.showGuides;
  if (els.autoFitText) els.autoFitText.checked = st.autoFitText ?? true;

  // art
  artDataUrl = st.artDataUrl ?? null;
  if (artDataUrl) {
    artImg = new Image();
    artImg.onload = () => render();
    artImg.src = artDataUrl;
  } else {
    artImg = null;
  }

  updateModeUI();
  validateFugu();
  render();
}

function validateFugu() {
  if (els.mode.value !== "player") {
    els.fuguHint.textContent = "";
    els.fuguHint.classList.remove("danger");
    return;
  }

  const rarity = els.rarity.value;
  const cap = RARITY_CAPS[rarity] ?? 20000;

  const raw = els.fugu.value ? Number(els.fugu.value) : 0;
  if (!Number.isFinite(raw)) {
    els.fuguHint.textContent = "数値を入力してください";
    els.fuguHint.classList.add("danger");
    return;
  }

  if (raw > cap) {
    els.fuguHint.textContent = `上限 ${cap.toLocaleString()} を超えています（出力は上限で表示）`;
    els.fuguHint.classList.add("danger");
  } else {
    els.fuguHint.textContent = `上限: ${cap.toLocaleString()}`;
    els.fuguHint.classList.remove("danger");
  }
}

function updateModeUI() {
  const isPlayer = els.mode.value === "player";
  els.playerOnlyRow1.style.display = isPlayer ? "" : "none";
  els.playerOnlyRow2.style.display = isPlayer ? "" : "none";
  els.playerOnlyRow3.style.display = isPlayer ? "" : "none";
  els.itemOnlyTips.style.display = isPlayer ? "none" : "";

  // font controls
  els.fontPlayerOnlyRow1.style.display = isPlayer ? "" : "none";
  els.fontPlayerOnlyRow2.style.display = isPlayer ? "" : "none";
  els.fontPlayerOnlyRow3.style.display = isPlayer ? "" : "none";
  els.fontItemOnlyRow.style.display = isPlayer ? "none" : "";
}


// ===== Role icon (draw in header circle) =====
const _roleIconRaw = {};
const _roleIconCanvas = {};
let _roleIconsRequested = false;

function ensureRoleIconsLoaded() {
  if (_roleIconsRequested) return;
  _roleIconsRequested = true;

  for (const [role, src] of Object.entries(ROLE_ICON_PNG_DATA_URLS)) {
    const img = new Image();
    img.onload = () => {
      _roleIconRaw[role] = img;
      _roleIconCanvas[role] = makeIconTransparent(img);
      // re-render when loaded
      try { render(); } catch (_) {}
    };
    img.src = src;
  }
}

function makeIconTransparent(img) {
  const w = img.naturalWidth || img.width;
  const h = img.naturalHeight || img.height;
  const c = document.createElement("canvas");
  c.width = w;
  c.height = h;
  const cctx = c.getContext("2d");
  cctx.drawImage(img, 0, 0, w, h);

  const id = cctx.getImageData(0, 0, w, h);
  const d = id.data;
  // sampled bg ≈ (220,224,224)
  for (let i = 0; i < d.length; i += 4) {
    const r = d[i], g = d[i + 1], b = d[i + 2];
    // kill very light pixels close to the bg (keeps antialias)
    if (r > 195 && g > 195 && b > 195) {
      const dist = Math.abs(r - 220) + Math.abs(g - 224) + Math.abs(b - 224);
      if (dist < 90) d[i + 3] = 0;
    }
  }
  cctx.putImageData(id, 0, 0);
  return c;
}

function drawRoleIcon(ctx, st) {
  if (!st || st.mode !== "player") return;
  const role = String(st.role || "").trim();
  if (!role) return;

  const icon = _roleIconCanvas[role];
  if (!icon) return;

  const off = st.offsets?.roleIcon || { x: 0, y: 0 };
  const size = Number(st.roleIconSize) || 64;
  const { cx, cy, r } = LAYOUT.roleIcon;

  ctx.save();
  ctx.beginPath();
  ctx.arc(cx + off.x, cy + off.y, r, 0, Math.PI * 2);
  ctx.clip();

  const x = (cx + off.x) - size / 2;
  const y = (cy + off.y) - size / 2;
  ctx.drawImage(icon, x, y, size, size);

  ctx.restore();
}


function render() {
  if (!templateImg.complete) return;
  const st = getState();
  setStatus("描画中…");

  // clear
  ctx.clearRect(0,0,els.canvas.width, els.canvas.height);

  // art (under template/frame)
  drawArt();

  // base template (frame drawn over art)
  ctx.drawImage(templateImg, 0, 0);

  // role icon (in header circle)
  drawRoleIcon(ctx, st);

  // text
  const color = st.textColor;
  const fs = st.fontSizes || {};
  const autoFitText = (st.autoFitText ?? true);

  const offsets = st.offsets || {};
  const meta = st.metaOffset || { x: 0, y: (st.metaYOffset ?? -64) }; // metaYOffset is legacy

  const getOff = (k) => ({ x: Number(offsets?.[k]?.x) || 0, y: Number(offsets?.[k]?.y) || 0 });
  const isMeta = (k) => (k === "rarity" || k === "fugu" || k === "orgrole");
  const boxFor = (k) => {
    const baseKey = (k === "itemTips") ? "tips" : k;
    const base = LAYOUT[baseKey];
    const o = getOff(k);
    const mx = isMeta(k) ? (Number(meta.x) || 0) : 0;
    const my = isMeta(k) ? (Number(meta.y) || 0) : 0;
    return shiftBox(base, o.x + mx, o.y + my);
  };

  // Header name & subtitle
  drawTextInBox({
    text: st.name,
    box: boxFor("name"),
    color,
    align: "center",
    valign: "middle",
    maxFont: Number(fs.name) || 52,
    minFont: 14,
    fontWeight: "900",
    autoFit: autoFitText,
  });

  drawTextInBox({
    text: st.subtitle ? `- ${st.subtitle}` : "",
    box: boxFor("subtitle"),
    color,
    align: "left",
    valign: "middle",
    maxFont: Number(fs.subtitle) || 34,
    minFont: 12,
    fontWeight: "900",
  });

  if (st.mode === "player") {
    const cap = RARITY_CAPS[st.rarity] ?? 20000;
    const fuguVal = clamp(Math.round(st.fugu || 0), 0, cap);

    // rarity label
    drawTextInBox({
      text: st.rarity,
      box: boxFor("rarity"),
      color,
      align: "left",
      valign: "top",
      maxFont: Number(fs.rarity) || 22,
      minFont: 10,
      fontWeight: "900",
      maxLines: 1,
    autoFit: autoFitText,
    });

    // fugu index number
    drawTextInBox({
      text: fuguVal ? String(fuguVal) : "",
      box: boxFor("fugu"),
      color,
      align: "left",
      valign: "top",
      maxFont: Number(fs.fugu) || 30,
      minFont: 12,
      fontWeight: "900",
      maxLines: 1,
    });

    // org/role line
    const orgRole = (() => {
      const o = (st.org || "").trim();
      return o || "";
    })();
drawTextInBox({
      text: orgRole,
      box: boxFor("orgrole"),
      color,
      align: "left",
      valign: "top",
      maxFont: Number(fs.orgRole) || 16,
      minFont: 10,
      fontWeight: "800",
      maxLines: 1,
    autoFit: autoFitText,
    });

    // ability large
    drawTextInBox({
      text: st.ability,
      box: boxFor("ability"),
      color,
      align: "left",
      valign: "top",
      maxFont: Number(fs.ability) || 64,
      minFont: 14,
      fontWeight: "900",
      lineGap: 1.05,
    });

    // debuff / tips
    drawTextInBox({
      text: st.debuff,
      box: boxFor("debuff"),
      color,
      align: "center",
      valign: "middle",
      maxFont: Number(fs.debuff) || 42,
      minFont: 12,
      fontWeight: "900",
      lineGap: 1.05,
    autoFit: autoFitText,
    });

    drawTextInBox({
      text: st.tips,
      box: boxFor("tips"),
      color,
      align: "center",
      valign: "middle",
      maxFont: Number(fs.tips) || 40,
      minFont: 12,
      fontWeight: "900",
      lineGap: 1.05,
    });
  } else {
    // Item card mode: use ability and itemTips, keep layout simple
    drawTextInBox({
      text: st.ability,
      box: boxFor("ability"),
      color,
      align: "left",
      valign: "top",
    maxFont: Number(fs.ability) || 58,
      minFont: 14,
      fontWeight: "900",
      lineGap: 1.05,
    autoFit: autoFitText,
    });

    drawTextInBox({
      text: st.itemTips,
      box: boxFor("itemTips"),
      color,
      align: "center",
      valign: "middle",
    maxFont: Number(fs.itemTips) || 36,
      minFont: 12,
      fontWeight: "900",
      lineGap: 1.05,
    });
  }

  drawGuides();

  setStatus("OK");
}

