function exportJson() {
  const st = getState();
  const blob = new Blob([JSON.stringify(st, null, 2)], { type: "application/json" });
  const a = document.createElement("a");
  a.href = URL.createObjectURL(blob);
  a.download = ((st.name || "card") + ".json").replace(/[^\w\-ぁ-んァ-ヶ一-龠々ー]/g, "_");
  a.click();
  URL.revokeObjectURL(a.href);
}

function importJsonFile(file) {
  const reader = new FileReader();
  reader.onload = () => {
    try {
      const st = JSON.parse(String(reader.result || ""));
      applyState(st);
      setStatus("JSON読込OK");
    } catch (e) {
      alert("JSONの読み込みに失敗: " + e.message);
    }
  };
  reader.readAsText(file, "utf-8");
}

function wireEvents() {
  const rerenderOn = ["input", "change"];

  // keep range + number inputs in sync
  const linkRangeNumber = (rangeEl, numEl) => {
    if (!rangeEl || !numEl) return;
    const syncToNum = () => (numEl.value = rangeEl.value);
    const syncToRange = () => (rangeEl.value = numEl.value);
    rangeEl.addEventListener("input", syncToNum);
    rangeEl.addEventListener("change", syncToNum);
    numEl.addEventListener("input", syncToRange);
    numEl.addEventListener("change", syncToRange);
  };

  linkRangeNumber(els.artZoom, els.artZoomNum);
  linkRangeNumber(els.artPanX, els.artPanXNum);
  linkRangeNumber(els.artPanY, els.artPanYNum);

  linkRangeNumber(els.fsName, els.fsNameNum);
  linkRangeNumber(els.fsSubtitle, els.fsSubtitleNum);
  linkRangeNumber(els.fsRarity, els.fsRarityNum);
  linkRangeNumber(els.fsFugu, els.fsFuguNum);
  linkRangeNumber(els.fsOrgRole, els.fsOrgRoleNum);
  linkRangeNumber(els.fsAbility, els.fsAbilityNum);
  linkRangeNumber(els.fsDebuff, els.fsDebuffNum);
  linkRangeNumber(els.fsTips, els.fsTipsNum);
  linkRangeNumber(els.fsItemTips, els.fsItemTipsNum);

  // position offsets
  linkRangeNumber(els.metaX, els.metaXNum);
  linkRangeNumber(els.metaY, els.metaYNum);
  linkRangeNumber(els.roleIconSize, els.roleIconSizeNum);
  // per-field position (range + number sync)
  const posPairs = [
    [els.posRoleIconX, els.posRoleIconXNum], [els.posRoleIconY, els.posRoleIconYNum],
    [els.posNameX, els.posNameXNum], [els.posNameY, els.posNameYNum],
    [els.posSubtitleX, els.posSubtitleXNum], [els.posSubtitleY, els.posSubtitleYNum],
    [els.posRarityX, els.posRarityXNum], [els.posRarityY, els.posRarityYNum],
    [els.posFuguX, els.posFuguXNum], [els.posFuguY, els.posFuguYNum],
    [els.posOrgRoleX, els.posOrgRoleXNum], [els.posOrgRoleY, els.posOrgRoleYNum],
    [els.posAbilityX, els.posAbilityXNum], [els.posAbilityY, els.posAbilityYNum],
    [els.posDebuffX, els.posDebuffXNum], [els.posDebuffY, els.posDebuffYNum],
    [els.posTipsX, els.posTipsXNum], [els.posTipsY, els.posTipsYNum],
    [els.posItemTipsX, els.posItemTipsXNum], [els.posItemTipsY, els.posItemTipsYNum],
  ];
  for (const [r, n] of posPairs) linkRangeNumber(r, n);


  const inputs = [
    els.mode, els.name, els.subtitle, els.rarity, els.fugu,
    els.org, els.role, els.ability, els.debuff, els.tips, els.itemTips,
    els.textColor, els.artFit,
    els.metaX, els.metaXNum, els.metaY, els.metaYNum,
    els.roleIconSize, els.roleIconSizeNum,
    els.posRoleIconX, els.posRoleIconXNum, els.posRoleIconY, els.posRoleIconYNum,
    els.posNameX, els.posNameXNum, els.posNameY, els.posNameYNum,
    els.posSubtitleX, els.posSubtitleXNum, els.posSubtitleY, els.posSubtitleYNum,
    els.posRarityX, els.posRarityXNum, els.posRarityY, els.posRarityYNum,
    els.posFuguX, els.posFuguXNum, els.posFuguY, els.posFuguYNum,
    els.posOrgRoleX, els.posOrgRoleXNum, els.posOrgRoleY, els.posOrgRoleYNum,
    els.posAbilityX, els.posAbilityXNum, els.posAbilityY, els.posAbilityYNum,
    els.posDebuffX, els.posDebuffXNum, els.posDebuffY, els.posDebuffYNum,
    els.posTipsX, els.posTipsXNum, els.posTipsY, els.posTipsYNum,
    els.posItemTipsX, els.posItemTipsXNum, els.posItemTipsY, els.posItemTipsYNum,
    els.artZoom, els.artZoomNum, els.artPanX, els.artPanXNum, els.artPanY, els.artPanYNum,
    els.fsName, els.fsNameNum, els.fsSubtitle, els.fsSubtitleNum,
    els.fsRarity, els.fsRarityNum, els.fsFugu, els.fsFuguNum, els.fsOrgRole, els.fsOrgRoleNum,
    els.fsAbility, els.fsAbilityNum, els.fsDebuff, els.fsDebuffNum, els.fsTips, els.fsTipsNum,
    els.fsItemTips, els.fsItemTipsNum,
    els.metaY, els.metaYNum,
    els.showGuides,
  ];

  for (const el of inputs) {
    for (const ev of rerenderOn) {
      el.addEventListener(ev, () => {
        updateModeUI();
        validateFugu();
        render();
      });
    }
  }

  els.btnDownload.addEventListener("click", downloadPng);
  els.btnReset.addEventListener("click", resetAll);

  els.btnPosReset?.addEventListener("click", (e) => {
    e.preventDefault();

    // group meta (rarity/fugu/org)
    if (els.metaX && els.metaXNum) { els.metaX.value = "-13"; els.metaXNum.value = "-13"; }
    if (els.metaY && els.metaYNum) { els.metaY.value = "-17"; els.metaYNum.value = "-17"; }

    // role icon size
    if (els.roleIconSize && els.roleIconSizeNum) { els.roleIconSize.value = "64"; els.roleIconSizeNum.value = "64"; }

    // per-field offsets
    const setPair = (r, n, v) => { if (r) r.value = String(v); if (n) n.value = String(v); };

    setPair(els.posRoleIconX, els.posRoleIconXNum, 0);
    setPair(els.posRoleIconY, els.posRoleIconYNum, 0);

    setPair(els.posNameX, els.posNameXNum, 0);
    setPair(els.posNameY, els.posNameYNum, 11);

    setPair(els.posSubtitleX, els.posSubtitleXNum, 0);
    setPair(els.posSubtitleY, els.posSubtitleYNum, 11);

    setPair(els.posRarityX, els.posRarityXNum, 0);
    setPair(els.posRarityY, els.posRarityYNum, 0);

    setPair(els.posFuguX, els.posFuguXNum, 0);
    setPair(els.posFuguY, els.posFuguYNum, 0);

    setPair(els.posOrgRoleX, els.posOrgRoleXNum, 0);
    setPair(els.posOrgRoleY, els.posOrgRoleYNum, 0);

    setPair(els.posAbilityX, els.posAbilityXNum, 0);
    setPair(els.posAbilityY, els.posAbilityYNum, 0);

    setPair(els.posDebuffX, els.posDebuffXNum, 0);
    setPair(els.posDebuffY, els.posDebuffYNum, -49);

    setPair(els.posTipsX, els.posTipsXNum, 0);
    setPair(els.posTipsY, els.posTipsYNum, 0);

    setPair(els.posItemTipsX, els.posItemTipsXNum, 0);
    setPair(els.posItemTipsY, els.posItemTipsYNum, 0);

    render();
  });


  els.btnArtReset.addEventListener("click", (e) => {
    e.preventDefault();
    els.artZoom.value = "1";
    els.artZoomNum.value = "1";
    els.artPanX.value = "0";
    els.artPanXNum.value = "0";
    els.artPanY.value = "0";
    els.artPanYNum.value = "0";
    render();
  });

  els.artFile.addEventListener("change", (e) => {
    const file = e.target.files?.[0];
    if (!file) return;
    const reader = new FileReader();
    reader.onload = () => {
      artDataUrl = String(reader.result);
      artImg = new Image();
      artImg.onload = () => render();
      artImg.src = artDataUrl;
    };
    reader.readAsDataURL(file);
  });

  els.btnClearArt.addEventListener("click", () => {
    artImg = null;
    artDataUrl = null;
    els.artFile.value = "";
    render();
  });

  // Drag on preview to pan the art
  let dragging = false;
  let startX = 0;
  let startY = 0;
  let startPanX = 0;
  let startPanY = 0;

  const toLocal = (clientX, clientY) => {
    const rect = els.canvas.getBoundingClientRect();
    // canvas is scaled in CSS; map back to canvas coords
    const sx = els.canvas.width / rect.width;
    const sy = els.canvas.height / rect.height;
    return {
      x: (clientX - rect.left) * sx,
      y: (clientY - rect.top) * sy,
      sx, sy,
    };
  };

  const setPan = (x, y) => {
    const clampedX = clamp(x, Number(els.artPanX.min), Number(els.artPanX.max));
    const clampedY = clamp(y, Number(els.artPanY.min), Number(els.artPanY.max));
    els.artPanX.value = String(clampedX);
    els.artPanXNum.value = String(clampedX);
    els.artPanY.value = String(clampedY);
    els.artPanYNum.value = String(clampedY);
  };

  els.canvas.addEventListener("pointerdown", (e) => {
    if (!artImg) return;
    dragging = true;
    els.canvas.setPointerCapture(e.pointerId);
    startX = e.clientX;
    startY = e.clientY;
    startPanX = Number(els.artPanX.value) || 0;
    startPanY = Number(els.artPanY.value) || 0;
  });

  els.canvas.addEventListener("pointermove", (e) => {
    if (!dragging || !artImg) return;
    // pixel delta in CSS space, translate to canvas space roughly
    const rect = els.canvas.getBoundingClientRect();
    const sx = els.canvas.width / rect.width;
    const sy = els.canvas.height / rect.height;
    const dx = (e.clientX - startX) * sx;
    const dy = (e.clientY - startY) * sy;
    setPan(startPanX + dx, startPanY + dy);
    render();
  });

  const stopDrag = () => { dragging = false; };
  els.canvas.addEventListener("pointerup", stopDrag);
  els.canvas.addEventListener("pointercancel", stopDrag);

  els.btnExportJson.addEventListener("click", exportJson);

  els.importJson.addEventListener("change", (e) => {
    const file = e.target.files?.[0];
    if (!file) return;
    importJsonFile(file);
    els.importJson.value = "";
  });
}

